import React, { Component } from 'react';


export default class Formulario extends Component {
    render() {
        return (
            <form>
                <input type="text" placeholder="data" />
                <input type="text" placeholder="hora" />
                <input type="text" placeholder="mins" />
                <button>Criar</button>
            </form>
        );
    }
}
